import Navbar from '../components/Navbar';
import Footer from '../components/Footer';
import Hero from '../components/Hero';
import Views from '../assets/outside5.jpg';

function Login() {
  return (
    <>
        <Navbar/>
        <Hero
            cName = "hero-about"
            heroImg = {Views}
            title = "Login"
            text = "Please login to start using the plartfom"
        />
        <Footer/>
    </>
  )
}

export default Login
